import constants from '../constant'
import classiftModel from '../mock/index'
import LinkDataModel, { mockItem, mockItemChilds } from '../types'

const TIMER = 100

@Entry
@Component
struct Index {
  @State isLoad: boolean = true
  @State list: mockItem[] = []
  @State currentFirstLevelId: number = -1

  aboutToAppear() {
    this.loadData()
  }

  loadData() {
    load().then(res => {
      this.list = res
      this.currentFirstLevelId = res[0].fid
      this.isLoad = false
    })

    function load(): Promise<mockItem[]> {
      return new Promise((res, rej) => {
        const timer = setTimeout(() => {
          const mockList = classiftModel.getMockData()
          res(mockList)
          clearTimeout(timer)
        }, TIMER)
      })
    }
  }

  @Builder
  firstLevelItem(item: mockItem, isSelect: boolean) {
    Row() {
      Text(item.title).fontSize(14).fontColor(isSelect ? '' : '')
    }
    .width('100%')
    .height(60)
    .backgroundColor(isSelect ? $r('app.color.classify_background') : $r('app.color.base_background'))
    .alignItems(VerticalAlign.Center)
    .justifyContent(FlexAlign.Center)
  }

  build() {
    if (this.isLoad) {
      Column() {
        Text('loading...').fontSize(30)
      }.width('100%').height('100%').justifyContent(FlexAlign.Center)
    } else {
      Row() {
        List() {
          ForEach(this.list, (item: mockItem) => {
            ListItem() {
              this.firstLevelItem(item, item.fid === this.currentFirstLevelId)
            }
          }, item => item.fid.toString())
        }.height('100%').layoutWeight(1).backgroundColor($r('app.color.classify_background'))

        List() {
          ForEach(this.list, (item: mockItem) => {
            ListItem() {
              Column() {
                Text(item.title)
                // every  childs
                Column() {
                  ForEach(item.childs, (item: mockItemChilds) => {
                    Row() {
                      Text(item.name)
                    }
                  }, (item: mockItemChilds) => item.id.toString())
                }
              }
            }
          }, (item: mockItem) => item.fid.toString())
        }.height('100%').layoutWeight(2).backgroundColor($r('app.color.base_background'))
      }
      .width('100%')
    }
  }
}

