export default class LinkDataModel {
  /**
   * parentId
   */
  superId: number;
  /**
   * ParentName
   */
  superName: string;
  id: number;
  courseName: string;
  imageUrl: Resource;
  price: number;

  constructor(superId: number, superName: string, id: number, courseName: string, imageUrl: Resource, price: number) {
    this.superId = superId;
    this.superName = superName;
    this.id = id;
    this.courseName = courseName;
    this.imageUrl = imageUrl;
    this.price = price;
  }
}

export class mockItem {
  fid: number
  title: string
  childs: mockItemChilds[]

  constructor(fid: number, title: string, childs?: mockItemChilds[]) {
    this.fid = fid;
    this.title = title;
    this.childs = childs || [];
  }
}

export class mockItemChilds {
  id: number
  name: string
  icon: Resource | string
  price: number

  constructor(id: number, name: string, icon: Resource, price: number) {
    this.id = id;
    this.name = name;
    this.icon = icon;
    this.price = price;
  }
}
